import React from 'react'

function Cell ({ cell, openPopup}){
    return(
        <div className='result' onClick={() => openPopup(cell.id)}>
            <img src = {cell.images[0].url} />
            <h3>{cell.name}</h3>

        </div >
    )
}

export default Cell;
